import React, { Component } from "react";
import { Form, Button, Input, Label, Col, FormGroup } from "reactstrap";
import { GeneratorInput as GeneratorColumnInput } from "./GeneratorColumnInput";

class GeneratorForm extends Component {
  constructor() {
    super();
    this.state = {
      numRows: "",
      modalOptions: ""
    };
  }

  render() {
    return (
      <Form>
        <GeneratorColumnInput />
        <GeneratorColumnInput />
        <GeneratorColumnInput />
        <FormGroup row>
          <Col md={3}>
            <Label>Number of Rows</Label>
            <Input
              type="number"
              name="numrows"
              id="numrows"
              onChange={e => this.setState({ numRows: e.target.value })}
            />
          </Col>
          <Col md={2}>
            <Input
              type="select"
              name="datatype"
              id={`type-${this.props.id}`}
              onChange={e => this.setState({ option1: e.target.value })}
            >
              <option>Integer</option>
              <option>Time-Series</option>
              <option>Email</option>
              <option>Phone Number</option>
            </Input>
          </Col>
        </FormGroup>
        <Button type="submit" color="primary">
          Generate Data
        </Button>
      </Form>
    );
  }
}

export { GeneratorForm };
